    private static Dictionary<byte, byte[]> CreateTransparation(Locale from, Locale to)
    {
      Dictionary<byte, byte[]> dictionary1 = Asda2CryptHelper.XorKeysByLocale[from];
      Dictionary<byte, byte[]> dictionary2 = Asda2CryptHelper.XorKeysByLocale[to];
      Dictionary<byte, byte[]> dictionary3 = new Dictionary<byte, byte[]>();
      foreach (KeyValuePair<byte, byte[]> keyValuePair in dictionary1)
