        for (int index = 0; index < keyValuePair.Value.Length; ++index)
          numArray[index] = (byte) ((uint) keyValuePair.Value[index] ^ (uint) dictionary2[keyValuePair.Key][index]);
        dictionary3.Add(keyValuePair.Key, numArray);
      }
      return dictionary3;
    }

    public static void XorData(byte[] buffer, int startIndex, long length, Locale encodedLocale, Locale targetLocale)
    {
      if (encodedLocale == targetLocale)
        return;
      byte index1 = buffer[startIndex];
      byte[] numArray = Asda2CryptHelper._encodingKeysTransparentions[new Locale?(encodedLocale)][targetLocale][index1];
      for (int index2 = 0; (long) index2 < length - 1L; ++index2)
        buffer[startIndex + index2 + 1] = (byte) ((int) buffer[startIndex + index2 + 1] ^ (numArray.Length <= index2 ? 0 : (int) numArray[index2]));
    }
